// src/AdminExits.js
import React, { useState, useEffect } from 'react';
import './AdminExits.css';

function AdminExits() {
  const [vehicles, setVehicles] = useState([]);
  const [exits, setExits] = useState([]);
  const [searchTerm, setSearchTerm] = useState('');
  const [paymentMethod, setPaymentMethod] = useState('');
  const [selectedVehicle, setSelectedVehicle] = useState(null);
  const [showModal, setShowModal] = useState(false);
  const [error, setError] = useState('');

  const fetchVehicles = async () => {
    const res = await fetch('/api/giris');
    const data = await res.json();
    setVehicles(data.filter(v => v.cikis_durumu === 'çıkmadı'));
  };

  const fetchExits = async () => {
    const res = await fetch('/api/cikis');
    const data = await res.json();
    setExits(Array.isArray(data) ? data : []);
  };

  useEffect(() => {
    fetchVehicles();
    fetchExits();
  }, []);

  const handleExit = async () => {
    if (!paymentMethod) {
      alert('Ödeme yöntemi seçiniz.');
      return;
    }

    const res = await fetch('/api/cikis', {
      method: 'POST',
      headers: { 'Content-Type': 'application/json' },
      body: JSON.stringify({
        arac_plaka: selectedVehicle.arac_plaka,
        odeme_yontemi: paymentMethod,
      }),
    });

    if (res.ok) {
      alert('Çıkış işlemi başarılı.');
      fetchVehicles();
      fetchExits();
      setShowModal(false);
    } else {
      const err = await res.json();
      setError(err.error || 'Çıkış yapılamadı.');
    }
  };

  return (
    <div className="admin-exits-container">
      <div className="left-panel">
        <h2>Otoparktaki Araçlar</h2>
        <input
          placeholder="Plaka ara..."
          onChange={(e) => setSearchTerm(e.target.value)}
          value={searchTerm}
        />
        <table>
          <thead>
            <tr>
              <th>Plaka</th>
              <th>Giriş Saati</th>
              <th>Park Alanı</th>
              <th>İşlem</th>
            </tr>
          </thead>
          <tbody>
            {vehicles.filter(v => v.arac_plaka.includes(searchTerm)).map(vehicle => (
              <tr key={vehicle.giris_ID}>
                <td>{vehicle.arac_plaka}</td>
                <td>{new Date(vehicle.giris_saat).toLocaleString()}</td>
                <td>{vehicle.yer_ad}</td>
                <td>
                  <button onClick={() => {
                    setSelectedVehicle(vehicle);
                    setShowModal(true);
                  }}>
                    Çıkış Yap
                  </button>
                </td>
              </tr>
            ))}
          </tbody>
        </table>
      </div>

      <div className="right-panel">
        <h2>Çıkış Yapan Araçlar</h2>
        <table>
          <thead>
            <tr>
              <th>Çıkış ID</th>
              <th>Plaka</th>
              <th>Çıkış Saati</th>
              <th>Ödeme Yöntemi</th>
              <th>Ücret</th>
            </tr>
          </thead>
          <tbody>
            {exits.map(exit => (
              <tr key={exit.cikis_ID}>
                <td>{exit.cikis_ID}</td>
                <td>{exit.arac_plaka}</td>
                <td>{new Date(exit.cikis_saati).toLocaleString()}</td>
                <td>{exit.odeme_yontemi}</td>
                <td>{exit.ucret} TL</td>
              </tr>
            ))}
          </tbody>
        </table>
      </div>

      {showModal && (
        <div className="modal">
          <h3>Ödeme Yöntemi Seçiniz</h3>
          <select onChange={(e) => setPaymentMethod(e.target.value)} value={paymentMethod}>
            <option value="">Seçiniz</option>
            <option value="kart">Kart</option>
            <option value="nakit">Nakit</option>
          </select>
          <button onClick={handleExit}>Onayla</button>
          <button onClick={() => setShowModal(false)}>İptal</button>
        </div>
      )}

      {error && <div className="error">{error}</div>}
    </div>
  );
}

export default AdminExits;
